import React from "react";
import Clock from "react-flip-clock-count-down";
import "../FilpClock.css"

class CountdownTimer extends React.Component {
    render() {
        return (
            <FlipCountdown
                endAt={'2024-01-31 23:59:59'}
                size="large"
                theme="dark"
                titlePosition="top"
                yearTitle="Year"
                monthTitle="Months"
                dayTitle="Days"
                hourTitle="Hours"
                minuteTitle="Minutes"
                secondTitle="Seconds"
                hideYear
                hideMonth
                hideDay
                onTimeUp={() => console.log("Time's up ⏳")}
            />
        );
    }
}
export default CountdownTimer;
